import {IndividualCard,ImageWrapper,ProductImage} from "./styles";
function CardDisplay({ id,name,brand,price,rating,image}:any) {

    return (
      
      <IndividualCard>       
        <ImageWrapper>
    
        <ProductImage src={image}/>
        </ImageWrapper>
        <h2>{id}</h2>
        <p>{name}</p>
        <p>Brand:{brand}</p>
        <p>Price:{price}</p>
        <p>{rating}</p>
        
      </IndividualCard>
    );
  }
  export default CardDisplay;
